import React from "react";
import "./TickerItem.scss";

function Ticker() {
  return (
    <side className="ticker-wrap">
      <nav className="ticker">
        <div className="ticker__item">ANIMALS ONLY!</div>
      </nav>
    </side>
  );
}

export default Ticker;
